ISLAMABAD, Feb 25 (APP):Uzbekistan Ambassador to Pakistan, Aybek A. Usmanov on Thursday called on Federal Minister for Maritime Affairs Syed Ali Haider Zaidi at his office in Islamabad.
During the meeting, they discussed matters related to ports and shipping in detail, said a press release.
